import React, { useEffect, useState } from 'react'


function App() {
  const [backendData, setBackendData] = useState([{}])
  useEffect (() => {
    fetch("/user/all").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }, [])

  const getBusRoutes = () => {
    fetch("/bus-routes/all").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }

  return (
    <div className="App">
      <HomePage/>
    </div>
  );
}

export default App;
